import './SelectLotFrame.css';



const SelectLotFrame = (props) => {
    return (
        <div className="select-lot">
            <ul className="select-lot__content">
                <li className='card'>One</li>

            </ul>

        </div>
    );
};

export default SelectLotFrame;
